import React, { useEffect, useRef, useState } from 'react';
import L from 'leaflet';
import 'leaflet/dist/leaflet.css';

// Fix default Leaflet marker icons
delete L.Icon.Default.prototype._getIconUrl;
L.Icon.Default.mergeOptions({
  iconRetinaUrl: 'https://unpkg.com/leaflet@1.9.4/dist/images/marker-icon-2x.png',
  iconUrl: 'https://unpkg.com/leaflet@1.9.4/dist/images/marker-icon.png',
  shadowUrl: 'https://unpkg.com/leaflet@1.9.4/dist/images/marker-shadow.png',
});

function Map() {
  const mapContainerRef = useRef(null);
  const mapInstanceRef = useRef(null);
  const [pendingLatLng, setPendingLatLng] = useState(null);
  const markersRef = useRef([]); // Keep track of all added markers

  useEffect(() => {
    if (!mapContainerRef.current || mapInstanceRef.current) return;

    const initTimeout = setTimeout(() => {
      const map = L.map(mapContainerRef.current, {
        center: [51.505, -0.09],
        zoom: 13,
      });

      mapInstanceRef.current = map;

      L.tileLayer('https://tile.openstreetmap.org/{z}/{x}/{y}.png', {
        maxZoom: 19,
        attribution: '¬© OpenStreetMap contributors',
      }).addTo(map);

      map.whenReady(() => {
        // --- Get user location ---
        if (navigator.geolocation) {
          navigator.geolocation.getCurrentPosition(
            (pos) => {
              const { latitude, longitude } = pos.coords;

              if (!mapInstanceRef.current || !mapInstanceRef.current._loaded) return;

              map.setView([latitude, longitude], 15);

              const userMarker = L.marker([latitude, longitude])
                .addTo(map)
                .bindPopup('üìç You are here');

              // Allow removing user marker by clicking
              userMarker.on('click', () => handleMarkerRemove(userMarker));

              markersRef.current.push(userMarker);
            },
            (err) => console.warn('Geolocation error:', err.message),
            { enableHighAccuracy: true }
          );
        }

        // --- Add marker on right-click ---
        map.on('contextmenu', function (e) {
          L.DomEvent.preventDefault(e);
          setPendingLatLng(e.latlng);
        });
      });
    }, 0);

    return () => {
      clearTimeout(initTimeout);
      if (mapInstanceRef.current) {
        mapInstanceRef.current.remove();
        mapInstanceRef.current = null;
      }
      markersRef.current = [];
    };
  }, []);

  // --- Handle adding new marker ---
  const handleConfirm = () => {
    if (pendingLatLng && mapInstanceRef.current) {
      const newMarker = L.marker(pendingLatLng)
        .addTo(mapInstanceRef.current)
        .bindPopup(
          `üìç Custom marker<br>(${pendingLatLng.lat.toFixed(5)}, ${pendingLatLng.lng.toFixed(5)})`
        );

      // Click to remove marker
      newMarker.on('click', () => handleMarkerRemove(newMarker));

      markersRef.current.push(newMarker);
    }
    setPendingLatLng(null);
  };

  // --- Remove marker safely ---
  const handleMarkerRemove = (marker) => {
    if (window.confirm('Remove this marker?')) {
      mapInstanceRef.current.removeLayer(marker);
      markersRef.current = markersRef.current.filter((m) => m !== marker);
    }
  };

  const handleCancel = () => setPendingLatLng(null);

  return (
    <div style={{ padding: '20px', backgroundColor: '#f4f7f9', minHeight: '100vh' }}>
      <div
        ref={mapContainerRef}
        id="map"
        style={{
          height: '70vh',
          width: '100%',
          borderRadius: '8px',
          boxShadow: '0 4px 12px rgba(0,0,0,0.1)',
          position: 'relative',
        }}
      />

      {pendingLatLng && (
        <div
          style={{
            position: 'fixed',
            top: '50%',
            left: '50%',
            transform: 'translate(-50%, -50%)',
            background: 'white',
            padding: '20px 30px',
            borderRadius: '12px',
            boxShadow: '0 4px 16px rgba(0,0,0,0.2)',
            zIndex: 1000,
            textAlign: 'center',
          }}
        >
          <p style={{ fontSize: '16px', marginBottom: '15px' }}>
            Add marker at<br />
            <strong>
              {pendingLatLng.lat.toFixed(5)}, {pendingLatLng.lng.toFixed(5)}
            </strong>
            ?
          </p>
          <div style={{ display: 'flex', justifyContent: 'center', gap: '10px' }}>
            <button
              onClick={handleConfirm}
              style={{
                background: '#007bff',
                color: 'white',
                border: 'none',
                padding: '8px 14px',
                borderRadius: '6px',
                cursor: 'pointer',
              }}
            >
              Confirm
            </button>
            <button
              onClick={handleCancel}
              style={{
                background: '#e0e0e0',
                border: 'none',
                padding: '8px 14px',
                borderRadius: '6px',
                cursor: 'pointer',
              }}
            >
              Cancel
            </button>
          </div>
        </div>
      )}
    </div>
  );
}

export default Map;
